import { ScrollView, StyleSheet, Text, View } from 'react-native';
import { ChartTherapyProgress } from '../components/Chart/ChartTherapyProgress';
import { HeroLight } from '../components/Hero/HeroLight';
import { Button } from './../components/Button';

const title = `Therapy Progress`;
const description = `Sessions started with 
high tremor and showed 61% reduction.`;
const buttonText = `Life with Cala Trio`;
const link = `List`;


export const SessionsScreen = props => {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      <HeroLight
        title={title}
        description={description}
        buttonText={buttonText}
        link={link}
      />
      <View style={styles.content}>
        <View style={styles.buttonWrapper}>
          <Button buttonText="7 days" onPress={() => ''} type='solid-green' />
          <Button buttonText="30 days" onPress={() => ''} type='outline-green' />
          <Button buttonText="Overall" onPress={() => ''} type='outline-green' />
        </View>
        <ChartTherapyProgress />
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width: '100%',
    backgroundColor: Colors.WHITE,
    //backgroundColor: 'red',
  },
  buttonWrapper: {
    width: '100%',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
  },
  content: {
    paddingHorizontal: 30,
    width: '100%',
    //backgroundColor: 'green',
  },
  description: {
    fontFamily: Fonts.FONT_FACE_DESCRIPTION,
    fontSize: Fonts.FONT_SIZE_DESCRIPTION,
    color: Colors.NAVY,
    textAlign: 'center',
    lineHeight: Fonts.FONT_SIZE_DESCRIPTION * 1.5,
    //backgroundColor: 'red',
  },
});
